import React from "react";
import "./ThisWeek.css";

interface ThisWeekProps {
  completedDays: string[];
}

function ThisWeek({ completedDays }: ThisWeekProps) {
  const daysOfWeek = ["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"];

  return (
    <div className="days-container">
        <div><h2 className="section-title">This Week</h2>
      <p className="section-subtitle">{completedDays.length}/7 Days</p></div>

      {daysOfWeek.map((day) => (
        <div
          key={day}
          className={`day ${completedDays.includes(day) ? "completed" : ""}`}
        >
          {day}
        </div>
      ))}
    </div>
  );
}

export default ThisWeek;
